sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.responseBody) {
    var returnedObject = JSON.parse(inputs.responseBody);
    if(returnedObject) {
      outputs.username = returnedObject.UserName;
      outputs.useremailaddress = returnedObject.UserEmailAddress;
      outputs.devicereportedname = returnedObject.DeviceReportedName;
      outputs.devicefriendlyname = returnedObject.DeviceFriendlyName;
      outputs.udid = returnedObject.Udid;
      outputs.platform = returnedObject.Platform;
      outputs.serial_number = returnedObject.SerialNumber;
      outputs.imei = returnedObject.imei;
      outputs.operating_system = returnedObject.OperatingSystem;
      outputs.ownership = returnedObject.Ownership;
      outputs.compliance_status = returnedObject.ComplianceStatus;
      outputs.enrollment_status = returnedObject.EnrollmentStatus;
      outputs.uuid = returnedObject.Uuid;
      if (returnedObject.Id) {
              outputs.id = returnedObject.Id.Value;
      }

    }
  }
})(inputs, outputs);

